The RegEx for SQL update and insert sentences would be:

UPDATE\s+[a-zA-Z_]+\s+SET\s+[a-zA-Z_]+\s*=\s*'.*'\s*WHERE\s+[a-zA-Z_]+\s*=\s*'.*';

INSERT\s+INTO\s+[a-zA-Z_]+\s+\(.*\)\s*VALUES\s*\(\s*'.*'\s*(,\s*'.*')*\s*\);

Valid SQL update and insert sentences may contain the following keywords and structures:

1. UPDATE table_name SET column1 = value1, column2 = value2 WHERE condition;
2. INSERT INTO table_name (column1, column2) VALUES (value1, value2);

Based on the above information, a regular expression (RegEx) for validating SQL update and insert sentences could be:

^(UPDATE|INSERT INTO) [a-zA-Z0-9_]+ \(.*\)( VALUES \(.*\)| SET .*)?;$

